import './App.css';
import Items from './components/Items/Items';
import Header from './components/Header/Header';
import { Route, Routes } from 'react-router';
function App() {
  return (
    <div className="App">
      <Header />
      <Routes>
        <Route path="/products" element={<Items />}></Route>
      </Routes>
    </div>
  );
}

export default App;
